        [bold]Моя дорогая Баронесса Стефания Тёрская![/bold]


        [italic]Из глубин космоса доносятся сигналы бедствия моего терпения! Ты снова терзаешь мою душу постоянными требованиями оснастить корабль "Барон" загадочным "ПлатьеМат"! Представляешь, какая неразрешимая задача встала перед нашим корабельным инженером? Мы исследовали каждую туманность, прочесали галактику вверх-вниз, обошли стороной опасные чёрные дыры и посетили заброшенные астероидные базы — но увы, ни следа вашего драгоценного мата мы не нашли!


