        И последний пункт нашего послания: умоляю, дайте своему покорному слуге возможность заняться более важными вопросами! Управлением судном! А не беготней по торговым планетам в поисках  "ПлатьеМатов", пригодным лишь для выдачи женских нарядов. Неужто нельзя оставить капитана хотя бы ненадолго в покое?!


        Будьте благоразумны и не утомляйте старого космического волка столь мелкими прихотями...

